import React from 'react';
import { Container, Card } from 'react-bootstrap';

const Home:React.FC = () => {
    return (
     <Container>
        <Card className='text-center'>
           <Card.Header>Hello</Card.Header>
           <Card.Img src='..//img/me.jpg' alt='me' />
           <Card.Body>
              <Card.Text>
                I'am Ionut Ciornei, frontend developer
              </Card.Text>
           </Card.Body>
        </Card>
     </Container>
    )
};

export default Home;
